  return (
    <div>
      {categoria}
      {productos.map((producto) => (
        <p>
          {" "}
          {producto.producto} - {producto.marca} - {producto.modelo} -{" "}
          {producto.precio}{" "}
        </p>
      ))}
    </div>
  );
}
